PROBLEM TYPE:
  PROBLEMTYPE: "Structure"
  SHAPEFCT: "Nurbs"
CONSTRAINT/EMBEDDED MESH COUPLING:
  COUPLING_STRATEGY: "nitsche"
  NITSCHE_STABILIZATION_PARAM: 10
  NITSCHE_WEIGHTING_PARAM: 0.5
CUT GENERAL:
  KERNEL_INTERSECTION_FLOATTYPE: "double"
  KERNEL_DISTANCE_FLOATTYPE: "double"
  GENERAL_POSITION_DISTANCE_FLOATTYPE: "double"
  GENERAL_POSITION_POSITION_FLOATTYPE: "double"
  DO_SELFCUT: false
  BOUNDARYCELL_CUBATURDEGREE: 4
  INTEGRATE_INSIDE_CELLS: false
DESIGN EMBEDDED MESH SOLID SURF COUPLING CONDITIONS:
  - E: 5
    COUPLINGID: 1
DESIGN EMBEDDED SOLID VOL BACKGROUND CONDITIONS:
  - E: 2
    COUPLINGID: 1
DESIGN SURF DIRICH CONDITIONS:
  - E: 4
    NUMDOF: 3
    ONOFF: [1, 0, 0]
    VAL: [0, 0, 0]
    FUNCT: [0, 0, 0]
  - E: 1
    NUMDOF: 3
    ONOFF: [0, 0, 1]
    VAL: [0, 0, 0]
    FUNCT: [0, 0, 0]
  - E: 7
    NUMDOF: 3
    ONOFF: [1, 0, 0]
    VAL: [0, 0, 0]
    FUNCT: [0, 0, 0]
  - E: 8
