    ONOFF: [0, 0, 1]
    VAL: [0, 0, 0]
    FUNCT: [0, 0, 0]
  - E: 9
    NUMDOF: 3
    ONOFF: [0, 1, 0]
    VAL: [0, 0, 0]
    FUNCT: [0, 0, 0]
DESIGN SURF NEUMANN CONDITIONS:
  - E: 6
    NUMDOF: 3
    ONOFF: [0, 1, 0]
    VAL: [0, -0.01, 0]
    FUNCT: [0, 0, 0]
IO:
  OUTPUT_BIN: true
  STRUCT_DISP: true
IO/RUNTIME VTK OUTPUT:
  INTERVAL_STEPS: 1
  OUTPUT_DATA_FORMAT: "binary"
  EVERY_ITERATION: false
IO/RUNTIME VTK OUTPUT/STRUCTURE:
  OUTPUT_STRUCTURE: true
  DISPLACEMENT: true
  STRESS_STRAIN: false
MATERIALS:
  - MAT: 1
    MAT_ElastHyper:
      NUMMAT: 1
      MATIDS: [3]
      DENS: 7.8e-07
  - MAT: 3
    ELAST_CoupSVK:
      YOUNG: 1
      NUE: 0.0
  - MAT: 2
    MAT_ElastHyper:
      NUMMAT: 1
      MATIDS: [4]
      DENS: 7.8e-07
  - MAT: 4
    ELAST_CoupSVK:
      YOUNG: 1
      NUE: 0.0
SOLVER 1:
  NAME: "Struct_Solver"
  SOLVER: "Superlu"
STRUCTURAL DYNAMIC:
  INT_STRATEGY: "Standard"
  LINEAR_SOLVER: 1
  DYNAMICTYPE: "Statics"
  RESULTSEVERY: 1
  NLNSOL: "fullnewton"
  TIMESTEP: 1
  NUMSTEP: 1
  MAXTIME: 2.0
  DAMPING: "None"
  M_DAMP: 1e-05
  K_DAMP: 1e-05
  TOLRES: 1e-09
  TOLDISP: 1e-08
  PREDICT: "TangDis"
  NORM_RESF: "Abs"
  NORM_DISP: "Abs"
  NORMCOMBI_RESFDISP: "And"
  MAXITER: 30
  DIVERCONT: "stop"
STRUCTURE KNOTVECTORS:
  PATCHES:
    - KNOT_VECTORS:
        - DEGREE: 2
          TYPE: "Interpolated"
          KNOTS: [0.0, 0.0, 0.0, 1.0, 1.0, 1.0]
        - DEGREE: 2
          TYPE: "Interpolated"
          KNOTS: [0.0, 0.0, 0.0, 1.0, 1.0, 1.0]
        - DEGREE: 2
          TYPE: "Interpolated"
          KNOTS: [0.0, 0.0, 0.0, 1.0, 1.0, 1.0]
      ID: 1
XFEM GENERAL:
  GMSH_DEBUG_OUT: false
  GMSH_CUT_OUT: false
  VOLUME_GAUSS_POINTS_BY: "Tessellation"
